window.bookSummaryJSON = "<p>The&nbsp;<i>New York Times</i>&nbsp;and&nbsp;<i>USA Today</i>&nbsp;best-selling series.&nbsp;</p> <p>While the Hell Divers cross an ocean to battle the machines, an old flesh-and-blood threat returns to the islands.</p> <p>The mission to Rio de Janeiro ended in victory, but it came at a dire cost, killing most of those who set out to rescue the stranded survivors. Even worse, the skinwalkers’ leader, Horn, escaped with his demonic crew and is coming to take the throne.</p> <p>Back at the Vanguard Islands, King Xavier Rodriguez has been severely injured in another battle to protect the kingdom. Now an infection threatens to kill the one man who can keep the peace. As he fights for survival, new intel from Rio de Janeiro gives humanity hope of destroying the biggest threat of all: the machines - if the machines don’t find the Vanguard Islands first.&nbsp;</p>"; 
